import React, { Component } from 'react';
import './App.css';
import SideBar from './Components/SideBar';

class App extends Component {
  render() {
    return (
      <div className="App" style={styles}>
        <h1>Full Boar Racing</h1>
        <SideBar/>
      </div>
    );

  }
}

const styles = {
  height : "100vh",
  width  : "100%"
}

export default App;
